import{_ as e,o as r,c as i,O as t}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 13.1-1204 Fees for filing documents and issuing certificates.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-1204.md","filePath":"vacode/13.1-1204.md"}'),a={name:"vacode/13.1-1204.md"},o=t('<h1 id="§-13-1-1204-fees-for-filing-documents-and-issuing-certificates" tabindex="-1">§ 13.1-1204 Fees for filing documents and issuing certificates. <a class="header-anchor" href="#§-13-1-1204-fees-for-filing-documents-and-issuing-certificates" aria-label="Permalink to &quot;§ 13.1-1204 Fees for filing documents and issuing certificates.&quot;">​</a></h1><p>The Commission shall charge and collect the following fees, except as provided in § <a href="http://law.lis.virginia.gov/vacode/12.1-21.2/" target="_blank" rel="noreferrer">12.1-21.2</a>:</p><ol><li>For filing any one of the following, the fee shall be $100:</li></ol><p>a. Articles of trust.</p><p>b. An application for registration as a foreign business trust.</p><p>c. Articles of domestication.</p><p>d. Articles of entity conversion.</p><ol start="2"><li>For filing any one of the following, the fee shall be $25:</li></ol><p>a. Articles of amendment.</p><p>b. Articles of restatement.</p><p>c. Articles of cancellation.</p><p>d. Articles of correction referred to in § <a href="http://law.lis.virginia.gov/vacode/13.1-1213/" target="_blank" rel="noreferrer">13.1-1213</a>, a copy of an amendment or a correction referred to in § <a href="http://law.lis.virginia.gov/vacode/13.1-1245/" target="_blank" rel="noreferrer">13.1-1245</a>, or an amended application for registration referred to in § <a href="http://law.lis.virginia.gov/vacode/13.1-1245/" target="_blank" rel="noreferrer">13.1-1245</a>, provided that an amended application shall not require a separate fee when it is filed with a copy of an amendment or a correction referred to in § <a href="http://law.lis.virginia.gov/vacode/13.1-1245/" target="_blank" rel="noreferrer">13.1-1245</a>.</p><p>e. A copy of an instrument of merger of a foreign business trust referred to in § <a href="http://law.lis.virginia.gov/vacode/13.1-1250/" target="_blank" rel="noreferrer">13.1-1250</a>.</p><p>f. Articles of merger.</p><p>g. Articles of trust surrender.</p><p>h. A copy of an instrument of entity conversion of a foreign business trust holding a certificate of registration to transact business in the Commonwealth.</p><p>i. An application for a certificate of cancellation of a foreign business trust.</p><ol start="3"><li>For filing any one of the following, the fee shall be $10:</li></ol><p>a. An application to reserve or to renew the reservation of a name for use by a domestic or foreign business trust.</p><p>b. A notice of the transfer of a name reserved for use by a domestic or foreign business trust.</p><ol start="4"><li>For issuing a certificate pursuant to § <a href="http://law.lis.virginia.gov/vacode/13.1-1285/" target="_blank" rel="noreferrer">13.1-1285</a>, the fee shall be $6.</li></ol><p>2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0621" target="_blank" rel="noreferrer">621</a>; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0373" target="_blank" rel="noreferrer">373</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0274" target="_blank" rel="noreferrer">274</a>; 2007, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0771" target="_blank" rel="noreferrer">771</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0101" target="_blank" rel="noreferrer">101</a>; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0130" target="_blank" rel="noreferrer">130</a>; 2013, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0025" target="_blank" rel="noreferrer">25</a>.</p>',22),n=[o];function l(s,f,c,g,p,h){return r(),i("div",null,n)}const v=e(a,[["render",l]]);export{u as __pageData,v as default};
